invitationLetter:
Salut, particip la construcția consensului Delta!
Delta este o platformă open source pentru monede digitale noi care rulează pe InternetComputer. Poți gestiona și folosi diverse monede digitale fără parole, chei private sau mnemonice. Te rog să accesezi acest link https://delta.kim/auto/download pentru a instala aplicația. Acum te invităm să ne alături în construirea consensului și crearea de monede.
DID recomandator: ${did}
